import React from 'react';
import './CreatePostButton.css'; // Make sure to link the correct CSS file

// Inside CreatePostButton component
import { useHistory } from 'react-router-dom';

const CreatePostButton = () => {
    const history = useHistory();

    const handleClick = () => {
        history.push('/create-post'); // Navigate to the Create Post page
    };

    return <button onClick={handleClick}>Create Post</button>;
};

export default CreatePostButton;
